import React from "react";


function ArticlePage() {
  const article_id = this.props.match.params.article_id
  return (

    <React.Fragment>
      <h1>Blog page </h1>



      <h1>{article_id}</h1>

    </React.Fragment>
  );
}

export default ArticlePage;
